import React from 'react';
import styled from 'styled-components';

const VendorListContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 2rem;
`;

const VendorList = () => {
  return (
    <VendorListContainer>
      <h1>Vendor List</h1>
      <p>Vendor listing page - Coming soon!</p>
    </VendorListContainer>
  );
};

export default VendorList;
